import React from 'react';
import { Box, MenuItem, Typography, Select, Button } from '@material-ui/core';
import { FormikHelpers, Formik, Form, Field } from 'formik';
import { ModelOTP } from './model';


const OTP = () => {


    return (
        <Box >
            <Box textAlign="left" padding="20px">
                <Typography variant="h4" component="h4" >DayOne</Typography>
            </Box>
            <Box>
                <Typography variant="h4" component="h4" >Let's get started!</Typography>
            </Box>
            <Box>
                <Formik
                    initialValues={{
                        country: '',
                        phone: ''
                    }}
                    onSubmit={(
                        values: ModelOTP,
                        { setSubmitting }: FormikHelpers<ModelOTP>
                    ) => {
                        setTimeout(() => {
                            console.log(values, 'value----')
                            setSubmitting(false);
                        }, 500);
                    }}
                >
                    {({ submitForm, onChange }) => (
                        <Form>
                            <Field
                                component={Select}
                                name="country"
                                label="+65"
                            >
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Twenty</MenuItem>
                                <MenuItem value={30}>Thirty</MenuItem>
                            </Field>
                            <Button
                                variant="contained"
                                color="primary"
                                onClick={submitForm}
                            >
                                Submit
                            </Button>
                        </Form>
                    )}
                </Formik>
            </Box>

        </Box >
    )
}

export default OTP;
